import { Box, Container, Typography } from "@mui/material";

function Etusivu() {
  return (
  <Box
    sx={{
      bgcolor: "background.paper",
      pt: 8,
      pb: 6,
    }}
  >
          <Typography
          component="h1"
          variant="h2"
          align="center"
          gutterBottom>
            Kysely 1
          </Typography>
  </Box>
  );
}

export default Etusivu;
